function validateDominicanId(t){if(!t)return!1;if(!(11===(t=(t=t.replace(/-/g,"")).trim()).length))return!1;if("000"===t.substr(0,3))return!1;let r=0;const n=parseInt(t.substr(10,1));for(let n=0;n<10;n++){let e=parseInt(t.substr(n,1))*parseInt("1212121212".substr(n,1));if(e>9){const t=e.toString();e=parseInt(t.charAt(0))+parseInt(t.charAt(1))}r+=e}return(10-r%10)%10===n}